import React, { useEffect } from 'react';

import AOS from 'aos';
import 'aos/dist/aos.css';


import HomePage from "./components/HomePage";

function App() {
  useEffect(() => {
    AOS.init({
      duration : 2000
    });
  }, []);
  return (
    <div>
      <HomePage />
    </div>
  );
}

export default App;
